import React from 'react';
import axios from 'axios';
import {useEffect, useState} from 'react';
import {Row, Col, Container} from 'react-bootstrap';
// import GamesCards from './GamesCards.js'


export const Games = () => {

    const [ initialState, setInitialState ] = useState([]);

    useEffect(() => {

        axios.get('http://localhost:3001/api/games')
        .then(res => {
            console.log(res)
            setInitialState(res.data)
        })
        .catch(error => {
            console.log(error)
        })

    })

    return(
        <Container >
            <Row className="row"> 
            <Col className="column">
        <div>
            <ul>
                { initialState.map(data=> 

                <li>
                    <div className="card">
                        {data.date}
                        {data.homeTeam}
                        {data.homeTeamCity}
                        {data.homeTeamScore}
                        {data.season}
                        {data.status}
                        {data.visitorTeam}
                        {data.visitorTeamScore}


                    </div>


                {/* {data.homeTeamCity}
                {data.homeTeamScore}
                {data.season}
                {data.status}
                {data.visitorTeam}
                {data.visitorTeamScore} */}
                </li>
                )}
            </ul>


            </div>    
                </Col>




           </Row>


       </Container>


    )
}
